import { PageMain } from "core";
import { Component } from "react";
import NotificationSystem from "react-notification-system";
import RegionInfoSection from '../../sections/regionInfoSection'

export default class RegionInfoAddPage extends Component{
    constructor(props)
    {
        super(props);

        this.state = {};

        this.notificationSystem = React.createRef();
    }

    render()
    {
        return (
            <>
                <PageMain title="افزودن مناطق" icon="circle-plus" footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                topButtons={[
                    {
                    title: "فهرست ضریب محرومیت",
                    url: GetUrl("deprivationListPage"),
                    color: "outline-primary",
                    icon: "list-search",
                    },
                ]}>
                <RegionInfoSection record={ null } />
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        )
    }
}
